	tests := []struct {
		name         string
		mesgDataList [][]byte
		assertFunc   func(t *testing.T, mesgPack *message.MessagePack[any])
		wantErr      bool
	}{
		{
			name:         "incomplete message pack",
			mesgDataList: mesgDataList[0:3],
			wantErr:      true,
		},
		{
			name:         "unmarshal success",
			mesgDataList: mesgDataList[:],
			assertFunc: func(t *testing.T, mesgPack *message.MessagePack[any]) {
				if assert.IsType(t, new(message.Body0801), mesgPack.PackBody) {
					packBody := mesgPack.PackBody.(*message.Body0801)

					assert.Equal(t, byte(0x00), packBody.MediaType)
					assert.Equal(t, byte(0x00), packBody.MediaContentType)

					mediaContentReader := bytes.NewReader(packBody.MediaContent)
					mediaContent, err := jpeg.Decode(mediaContentReader)

					if assert.NoError(t, err) {
						assert.Equal(t, 320, mediaContent.Bounds().Size().X)
						assert.Equal(t, 240, mediaContent.Bounds().Size().Y)
					}
				}

			},
			wantErr: false,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			mesgPacks := make([]*message.MessagePack[*message.PartialPackBody], len(tt.mesgDataList))

			for i, mesgData := range tt.mesgDataList {
				mesgPack := new(message.MessagePack[*message.PartialPackBody])

				err := mesgPack.UnmarshalBinary(mesgData)

				if !assert.NoError(t, err) {
					t.FailNow()
				}

				mesgPacks[i] = mesgPack
			}

			mesgPack := new(message.MessagePack[any])
			err := ConcatUnmarshal(mesgPacks[:], mesgPack)

			if tt.wantErr {
				assert.Error(t, err)
			} else if assert.NoError(t, err) {
				tt.assertFunc(t, mesgPack)
			}
		})
	}
